    console.log(product);
    return(
        // <h1>Products</h1>
        <div class="div_main">
                            <div class="div_img">
                                <img class="image-grid-col-2 " src={product.img[0]}/>
                            </div>
                            <div class="div_txt">
                                <h1>{product.name}</h1>
                                {/* <h6>{product.description}</h6> */}
